import {
  Button,
  Box
} from "@mui/material";
const MaterialUi = ()=>{
  const design = (
    <>
      <Button
          variant="contained"
          color="secondary"
          sx={{
            "&:hover":{
              background: "red"
            },
            "&:focus":{
              background: 'yellow'
            }
          }}
          >
          Submit
      </Button>
      <Box sx={{width:"300px", height:"200px", background: "red"}}></Box>
    </>
  )
  return design;
}

export default MaterialUi;
